import { NavLink } from "react-router-dom"

function Nav({ dogs }) {
  const links = dogs.map(dog => (
    <NavLink 
      key={dog.name} 
      to={`/dogs/${dog.name.toLowerCase()}`} 
    >
      {dog.name}
    </NavLink>
  ));

  return (
    <nav>
      <NavLink to="/dogs" end>
        home
      </NavLink>
      {links}
    </nav>
  );
}

export default Nav;
